import React from 'react';
import App from '../../App';
import '../../App.css';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import Cards1 from '../cards1';
import Navlogout from '../navlogout';

function Homelogout() {
  return (
    <>
      <Navlogout />
      <HeroSection />
      <Cards1 />
      <Footer />
    </>
  );
}

export default Homelogout;
